function toggleAll(expand){document.querySelectorAll('details').forEach(d=>d.open=expand);}
function escapeHtml(str){if(str===undefined||str===null)return '';return String(str).replace(/&/g,'&amp;').replace(/</g,'&lt;').replace(/>/g,'&gt;');}
function createTable(rows){
 if(!rows||Object.keys(rows).length===0) return '<p style="color:#777;font-style:italic">None</p>';
 let keys=new Set();for(const r of Object.values(rows)){for(const k of Object.keys(r))keys.add(k);}const cols=Array.from(keys);
 let html='<table><tr>'+cols.map(k=>'<th>'+escapeHtml(k)+'</th>').join('')+'</tr>';
 for(const [id,r]of Object.entries(rows)){
   const label='';
   /* no header row */
   html+='<tr>'+cols.map(k=>{ const v=r[k]; const out=(v&&typeof v==='object')?JSON.stringify(v,null,2):v; return '<td><pre>'+escapeHtml(out)+'</pre></td>'; }).join('')+'</tr>';
 }
 html+='</table>';return html;}
function build(){const c=document.getElementById('content');for(const [section,det]of Object.entries(data.details)){
 const summary=data.summary[section]||{};
 const sec=document.createElement('section');
 const detailsEl=document.createElement('details');
 const head=document.createElement('summary');
 head.innerHTML=`<span style='color:#9ef'>${section}</span>`+
 `<span class='added'> +${summary.added||0}</span>`+
 `<span class='removed'> -${summary.removed||0}</span>`+
 `<span class='changed'> ^${summary.changed||0}</span>`;
 detailsEl.appendChild(head);
 const add=det.added||{};const rem=det.removed||{};const ch=det.changed||{};
 detailsEl.innerHTML+='<h3 class="added">Added</h3>'+createTable(add);
 detailsEl.innerHTML+='<h3 class="removed">Removed</h3>'+createTable(rem);
 detailsEl.innerHTML+='<h3 class="changed">Changed</h3>';
 if(Object.keys(ch).length===0){detailsEl.innerHTML+='<p style="color:#777;font-style:italic">None</p>';}
 else{
   for(const [id,diff]of Object.entries(ch)){
     const beforeName=diff.before&& (diff.before.gamevalName||diff.before.name);
     const afterName=diff.after&& (diff.after.gamevalName||diff.after.name);
     const readable=afterName||beforeName||'';
     detailsEl.innerHTML+=`<details><summary>ID ${id}${readable?' ('+escapeHtml(readable)+')':''}</summary>`+
       `<h4>Before</h4><pre>${escapeHtml(JSON.stringify(diff.before,null,2))}</pre>`+
       `<h4>After</h4><pre>${escapeHtml(JSON.stringify(diff.after,null,2))}</pre></details>`;
   }
 }
 sec.appendChild(detailsEl);c.appendChild(sec);}}
build();
</script>
